import React from 'react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css';

import DashboardIcon from '@mui/icons-material/Dashboard';
import PeopleIcon from '@mui/icons-material/People';
import CardTravelIcon from '@mui/icons-material/CardTravel';
import BookOnlineIcon from '@mui/icons-material/BookOnline';
import LocalOfferIcon from '@mui/icons-material/LocalOffer';
import RateReviewIcon from '@mui/icons-material/RateReview';
import LoyaltyIcon from '@mui/icons-material/Loyalty';

export default function Sidebar() {
  return (
    <aside className="sidebar">
      <div className="brand">
        <TravelExploreIcon fontSize="large" /> <span>PackPlango Admin</span>
      </div>
      <nav className="nav">
        <NavLink to="/" end className="nav-item"><DashboardIcon/> <span>Dashboard</span></NavLink>
        <NavLink to="/users" className="nav-item"><PeopleIcon/> <span>Users</span></NavLink>
        <NavLink to="/packages" className="nav-item"><CardTravelIcon/> <span>Packages</span></NavLink>
        <NavLink to="/bookings" className="nav-item"><BookOnlineIcon/> <span>Bookings</span></NavLink>
        <NavLink to="/deals" className="nav-item"><LocalOfferIcon/> <span>Deals</span></NavLink>
        <NavLink to="/reviews" className="nav-item"><RateReviewIcon/> <span>Reviews</span></NavLink>
        <NavLink to="/rewards" className="nav-item"><LoyaltyIcon/> <span>Rewards</span></NavLink>
      </nav>
      <div className="sidebar-footer">v1.0 â€¢ Admin</div>
    </aside>
  );
}
